import react from "react";

const ExpenseFormButton = (props) => {
  const NewExpenseButtonHandler = (event) => {
    props.newExpenseClick(event.preventDefault());
    console.log("The link was clicked.");
  };
  return (
    <div>
      <button type="submit" onClick={NewExpenseButtonHandler}></button>
    </div>
  );
};
export default ExpenseFormButton;
